import { Card, Layout, Typography } from 'antd'
import Meta from 'antd/es/card/Meta';
import React, { useEffect } from 'react'
import useFetchFriends from '../../services/useFetchFriends';
import "./Status.css";
const { Title } = Typography;

function Status() {
    const blob = ""
    const[ friends , fetchFriendsOfUser] = useFetchFriends();
    const user="afshal@gmail.com";

    useEffect(() => {
        fetchFriendsOfUser(user);  
    },[]);
    
    return (
        <Layout className='status-layout'>
            <Card style={{ height: "100%" }}>
                <Meta
                    title="Online Friends"
                    style={{marginBottom:10}}
                />
                { friends.map( (friend) => {
                    return (
                        <div
                            style=
                            {{
                            display: "flex",
                            flexDirection: "row",
                            alignItems: "center",
                            marginBottom: "0.3em",
                            }}
                            key={friend[0].user_id}
                            >
                                <img src={"data:image/png;base64,"+blob} style={{width:37,height:37,borderRadius:"100%",}} alt=""/>
                            <Title level={5} style={{marginBottom: "1.7em",marginLeft:10}}>{ friend[0].name.charAt(0).toUpperCase() + friend[0].name.slice(1) }</Title>
                        </div>
                    );
                }) }
            </Card>
        </Layout>
    )
}

export default Status